import { useEffect, useState } from 'react';
import './styles.css';
import { AxiosRequestConfig } from 'axios';
import { requestBackend } from 'util/requests';

type SecurityPolicy = {
  code: string;
  enableAd: string;
  passwordQtyMinKeys: string;
};

const SecurityPolicyTable = () => {


    const [securityPolicy, setSecurityPolicy] = useState<SecurityPolicy[]>([])

    useEffect(() => {
        const params: AxiosRequestConfig = {
          method: 'GET',
          url: '/security-policy',
          withCredentials: true
        };

        requestBackend(params)
          .then((response) => {
            setSecurityPolicy(response.data);
          })
          .catch((error) => {
            console.log('DEU ERRO', error);
          });
      }, []);


  return (
    <div className="security-police-table-container">
      <table className="table">
        <thead>
          <tr className="security-police-table-header">
